    "2013-07-19T16:00:28.098765",nt"name": "iowa-dnr-nrgis-library4d463",nt"isopen":
    false,nt"url": null,nt"notes": "The Natural Resources Geographic Information
    System (NRGIS) Library is a Geographic Information System (GIS) repository developed
    and maintained by the GIS Section of the Iowa Department of Natural Resources (DNR).
    It is a collection of more than 20,000 geographically referenced databases. The
    purpose of the NRGIS Library is to improve the availability, integration, and analysis
    of natural resource information and improve decisions to carry out agency responsibilities
    related to the management, protection and development of Iowa's natural resources.
    The NRGIS Library is seen as a one-stop repository for all of Iowa's natural resource,
    geographic information.",nt"license_title": null,nt"extras": [{ntt"key":
